aset_query":"{\\"database\\":2,\\"type\\":\\"native\\",\\"native\\":{\\"template-tags\\":{},\\"query\\":\\"with lagged_vwap as (\\\\nselect\\\\nf_stock.company_key,\\\\nd_company.industry,\\\\nconvert_timezone('UTC','America/New_York', timestamp_from_parts(d_date.year, d_date.month, day(d_date.date), d_date.hour, d_date.minute, 0)) as derived_timestamp,\\\\nf_stock.volume_weighted_average_price,\\\\nlag(f_stock.volume_weighted_average_price) over (partition by f_stock.company_key, d_company.industry order by timestamp_from_parts(d_date.year, d_date.month, day(d_date.date), d_date.hour, d_date.minute, 0)) as previous_volume_weighted_average_price,\\\\nf_stock.volume\\\\nfrom investment_analytics.stocks.fact_stock_aggregates as f_stock\\\\ninner join investment_analytics.stocks.dim_date as d_date \\\\non f_stock.date_key = d_date.date_key\\\\ninner join investment_analytics.core.dim_company as d_company\\\\non f_stock.company_key = d_company.company_key\\\\nwhere d_company.is_current = true\\\\nand d_date.date = convert_timezone('UTC', 'America/New_York', current_timestamp())::date\\\\n)\\\\n\\\\nselect \\\\nderived_timestamp,\\\\nindustry,\\\\ncast(avg(100 * (volume_weighted_average_price - previous_volume_weighted_average_price) / previous_volume_weighted_average_price) as number(38,3)) as avg_pct_volume_weighted_average_price_movement,\\\\nsum(volume) as total_volume\\\\nfrom lagged_vwap\\\\nwhere previous_volume_weighted_average_price is not null\\\\ngroup by derived_timestamp, industry\\\\norder by derived_timestamp asc, avg_pct_volume_weighted_average_price_movement desc;\\\\n\\"}}","last_editor_id":1,"collection_location":null,"id":72,"last_edited_at":"2025-10-18T05:01:13.52541Z","dashboardcard_count":1,"collection_type":null,"display":"table","archived_directly":false,"verified":null,"dashboard_id":null,"created_at":"2025-09-21T06:28:19.372963Z","model":"card"}	2025-12-29 07:55:41.561619+00	2025-12-29 07:55:41.561619+00	f	2025-10-18 05:01:13.50158+00	f	\N	\N	A