entiment vs Final Closing Price","description":null,"collection_name":"Jacob Palinski's Personal Collection"}	{"description":null,"archived":true,"display_type":"line","collection_position":null,"database_id":2,"collection_id":4,"official_collection":null,"name":"Sentiment vs Final Closing Price","collection_name":"Jacob Palinski's Personal Collection","collection_authority_level":null,"creator_id":1,"updated_at":"2025-10-19T00:07:07.420419Z","moderated_status":null,"dataset_query":"{\\"database\\":2,\\"type\\":\\"native\\",\\"native\\":{\\"template-tags\\":{},\\"query\\":\\"with company_prices as (\\\\nselect\\\\nd_company.company_name,\\\\nd_date.date,\\\\nmax_by(f_stock_aggregates.closing_price, d_date.date_key) as closing_price\\\\nfrom investment_analytics.stocks.fact_stock_aggregates as f_stock_aggregates\\\\ninner join investment_analytics.stocks.dim_date as d_date\\\\non f_stock_aggregates.date_key = d_date.date_key\\\\ninner join investment_analytics.core.dim_company as d_company\\\\non f_stock_aggregates.company_key = d_company.company_key\\\\nwhere d_company.is_current = true\\\\nand d_company.company_name not in ('Non Company','Retail Investor')\\\\ngroup by d_company.company_name, d_date.date\\\\n),\\\\n\\\\ncompany_sentiment as (\\\\nselect\\\\nd_company.company_name,\\\\nd_sentiment_date.date,\\\\nf_sentiments.article_sentiment_source,\\\\navg(f_sentiments.sentiment_score) as company_sentiment\\\\nfrom investment_analytics.sentiment.fact_sentiments as f_sentiments\\\\ninner join investment_analytics.sentiment.dim_sentiment_date as d_sentiment_date\\\\non f_sentiments.sentiment_date_key = d_sentiment_date.sentiment_date_key\\\\ninner join investment_analytics.core.dim_company as d_company\\\\non f_sentiments.company_key = d_company.company_key\\\\nwhere d_company.is_current = true\\\\nand d_company.company_name not in ('Non Company','Retail Investor')\\\\ngroup by d_company.company_name, d_sentiment_date.date, f_sentiments.article_sentiment_source\\\\n